import { takeLatest, all, call, put } from 'redux-saga/effects';

import { googleSigninStart, googleSigninSuccess, googleSigninFailed } from './user.action';

import { GOOGLE_SIGNIN_START } from '../../types/types';

import { auth, googleProvider } from '../../firebase/firebase.utils';

export function* signInWithGoogle() {
    try {
        const userRef = yield auth.signInWithPopup(googleProvider);
        console.log(userRef)
    }
    catch (error) {

    }

}

export function* onGoogleSignInStart() {
    yield takeLatest(GOOGLE_SIGNIN_START)
}
